text:
@AppropsDems @rosadelauro @RepGraceMeng @RepEspaillat @ATFHQ @NOAA @RepDWStweets @NormaJTorres We just finished the last appropriation bill to come out of the Appropriations Committee.

Republicans are making us less safe and underinvesting in innovation and scientific research.

We're going to continue to fight this on the floor. https://t.co/0xy4Xqbxh6

@AppropsDems @rosadelauro @RepGraceMeng @RepEspaillat @ATFHQ @NOAA @RepDWStweets @NormaJTorres The reforms in my amendment would strengthen oversight and protect taxpayer dollars.

Republicans voted down this amendment.
This is like refusing to hire an accountant because you don't want the bad news and don't want to be held to a standard.

@NOAA research labs are essential to preparing for the devastating severe weather events that are only becoming more common, and protecting key environmental resources like the Great Lakes we rely on.

@RepDWStweets amendment would stop funds in this bill from closing down NOAA weather and climate labs and cooperative institutes.

I voted in favor of this amendment, and I'm glad to see it adopted.

@AppropsDems I am deeply concerned about this bill.

It's cuts to the Economic Development Administration will rip away opportunities for communities like ours to get ahead.

When we shortchange investment at home, we hand our global competitors an advantage. https://t.co/xa32SZF3ot

@AppropsDems We just finished opening comments on the bill.

Again and again, Republicans show the American people are not their priority.

Their proposed spending would threaten our national security, make families less safe, harm our competitiveness, and threaten women's health and safety.

Investing in the education and retention of our nursing workforce is a critical way to tackle the nursing shortage we're facing across the country.

@RepUnderwood's amendment would restore funding to the title 8 nursing workforce development program which this bill plans to cut by 15%.

The Republican majority did not allow this amendment to pass.

@AppropsDems @NIH @rosadelauro @RepStenyHoyer @RepMarkPocan Keeping older Americans fed must be a priority.

@_MealsOnWheels not only keeps seniors fed, but provides a point of contact for people who may be otherwise isolated.

Republicans just abandoned our seniors and voted against an amendment to support this critical program.

@RepStenyHoyer's amendment would require the NIH to brief Congress on the impacts of the politicization of American science, including the cancellation of national institutes of health grants and the loss of scientists.

Republicans refused to support this amendment.

If they are so supportive of the President's agenda, why do they refuse to increase transparency and show the public what is really going on?

@AppropsDems @NIH @rosadelauro Title I is a cornerstone of our federal investment in public education.

Republicans proposed cuts to the program that would kick 72,000 teachers out of classrooms.

The amendment to protect teachers and students from these devastating cuts? Voted down by the Republican majority.

@TrilliumNY and health centers like it are lifelines for Rochester families.

Trump's cuts to Medicaid put their future—and our neighbors’ access to care—at risk.

I’m standing with our local partners to protect the healthcare our community depends on. https://t.co/bUTqCYqePH

Today we celebrate the Red Cross's 144th birthday.

Rochester is the proud home of the first-ever American
@RedCross blood donation center and volunteers in our community keep that legacy alive to this day.

@HouseGOP passed a budget that guts health care, slashes food assistance, and hands more tax breaks to billionaires.

It’s a cash grab—and working families are stuck with the bill.

I voted NO.
